import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="min-h-screen bg-red-50 flex flex-col items-center justify-center text-center text-red-900 px-6">
      <h1 className="text-5xl font-bold mb-4">Welcome to the Earthquake Dashboard</h1>
      <p className="text-lg mb-6 max-w-xl">
        Explore seismic trends, make predictions, and stay informed with our interactive tools.
      </p>
      <Link to="/predict">
        <button className="bg-red-700 text-white px-6 py-3 rounded-full shadow hover:bg-red-800 transition">
          Start Predicting
        </button>
      </Link>
    </div>
  );
}

export default Home;
